-- RMQ problem via sparse table
-- preprocessing O(n*log n) 
-- query O(1)

-- build sparse table
-- constructN :: Int -> (Vector a -> a) -> Vector a
build :: (V.Vector Int) -> V.Vector Int
build iv = V.constructN size step
    where
        step v | k == 0 = iv V.! gi
               | otherwise = max p1 p2
            where
                p1 = v V.! (ind i (k-1))
                p2 = v V.! (ind i' (k-1))
                gi = length v
                (k,i) = divMod gi lnth
                i' = i + 2^(k-1)
        size = lnth*(mk+1)
        mk = log2 lnth        
        ind = indx lnth
        lnth = V.length iv

-- query using sparse table
q :: (V.Vector Int) -> (V.Vector Int) -> Int -> Int -> Int
q sparse_t lst l r = let
                k' = log2 (r-l+1)
                i' = (r-2^k'+1)
                mp1 = sparse_t V.! (indx size l k')
                mp2 = sparse_t V.! (indx size i' k')
                size = V.length lst
               in max mp1 mp2

-- helper to fast test
query :: (V.Vector Int) -> Int -> Int -> Int
query l = q (build l) l


indx l i k = k*l+i

log2 :: Int -> Int
log2 n = floor ( logBase 2 (fromIntegral n))


-- unfoldrExactN :: Int -> (b -> (a, b)) -> b -> Vector a
b :: (V.Vector Int) -> (V.Vector Int)
b v = V.unfoldrN (length v) it (0, [])
    where
        it (i,stack) = if (i < V.length v) then Just $ (l,(i+1,i:dstack)) else Nothing

            where
                e = v V.! i
                dstack = dropWhile (\i -> (v V.! i) >= e) stack
                sp = head dstack
                l = if null dstack then 0 else sp+1

        



solve :: (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> (V.Vector Int) -> Int -> Int -> Int
solve il b sparse iv il_ b_ sparse_ iv_ d m = traceShowId (fnd d il b sparse iv) + traceShowId (fnd d_ il_ b_ sparse_ iv_) - 1
    where
        d_ = (V.length il - 1) - d
        fnd d il bv sparse iv = (traceShowId d) - (traceShowId lb) + 1
            where
                lb = search_bound (traceShowId prev_mi) (d)
                prev_mi = bv V.! d
                search_bound fi ti
                        | (fi == ti) = if ((iv V.! fi) <= lim) then fi else fi+1
                        | (fi + 1 == ti) && ((iv V.! ti) > lim) = ti+1
                        | (fi + 1 == ti) && ((iv V.! fi) > lim) = ti
                        | (fi + 1 == ti) && ((iv V.! fi) <= lim) = fi
                        | all_interval_in = fi
                        | right_in = search_bound fi (mid-1)
                        | otherwise = search_bound mid ti
                    where
                        all_interval_in = q sparse il fi ti <= lim
                        right_in = q sparse il mid ti <= lim
                        mid = (fi+ti) `div` 2
                        lim = ad+m
                ad = iv V.! d
        
